import React from "react";
import Footer from "../../components/Footer";
import Header from "../../components/Header";

const Profile = () => {
  return (
    <>
      <Header />
      <Container>
        <ProfileSection>
          <ProfileImage src="https://via.placeholder.com/200" alt="User profile" />
          <Name>John Doe</Name>
          <Email>john.doe@example.com</Email>
        </ProfileSection>
      </Container>
      <Footer />
    </>
  );
};

export default Profile;
